import React from "react";
import { Table, Row } from "antd";

const columns = [
  {
    title: "ID",
    dataIndex: "id",
    key: "id",
  },
  {
    title: "Name",
    dataIndex: "name",
    key: "name",
  },
  {
    title: "Status",
    dataIndex: "status",
    key: "status",
  },
  {
    title: "Address",
    dataIndex: "address_link",
    key: "address",
    render: (text) => {
      return (
        <>
          <Row>{text["addr1"]}</Row>
          <Row>{text["addr1"]}</Row>
        </>
      );
    },
  },
  {
    title: "Country Code",
    dataIndex: "countryIsoCode",
    key: "countryCode",
  },
];

const HcpTable = ({ data, loading, onSelectRow }) => (
  <Table
    style={{ width: "80%" }}
    loading={loading}
    columns={columns}
    dataSource={data}
    title={() => "Health Care Providers"}
    onRow={(record) => {
      return {
        onClick: () => {
          onSelectRow(record);
        },
      };
    }}
    rowKey="id"
    bordered
  />
);

export default HcpTable;
